import styled from "styled-components";


export const LoginWrapper = styled.form`
    width: 100%;
    height: auto;
    gap: 15px;
    place-content: center;
    justify-items: center;
    display: grid;
    z-index: 9;
    position: center;
    top: 50%;
`;
